// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract A {
    address public owner = msg.sender;
uint public num;
    function a(uint _num) public {
        require(msg.sender == owner, "fail");
        num = _num;
    }

    function change(address ab) public {
        require(msg.sender == owner, "change fail");
        owner = ab;
    }
}

